import React from 'react';

const Skills: React.FC = () => {
  return (
    <div className="section min-h-screen flex flex-col justify-center items-center text-center">
      <h1 className="text-4xl mb-4 text-[#61dafb]">Skills</h1>
      <p className="text-xl mb-2">This is the skills page where you can list your skills.</p>
    </div>
  );
}

export default Skills;
